import { useParams } from "react-router";
import Mvideo from "./Mvideo";
import { useState } from "react";
const MMvideo = () => {
  let { id } = useParams();
  const [data, setdata] = useState([]);
  async function all() {
    console.log(id);
    const res = await fetch(`https://netflix-ankit.ankitzxi05.repl.co/${id}`);
    console.log(res);
    const data2 = await res.json();
    let arr = [];
    arr.push(<Mvideo link={data2.url} />);

    setdata(arr[0]);
  }
  all();
  return { data };
};

export default MMvideo;
